import React from 'react';


function ListItems(props){
    const items = props.items
    const listItem = items.map(item =>{
        return (
            <div className='list' id='ikey'>
                {item.text}
            </div>
        )
    })
    return(
        <h2>{listItem}</h2>
    )
}

export default ListItems;
